import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App'
import { BrowserRouter } from 'react-router-dom'


ReactDOM.render(
  <Router>
    <Switch>
      <Route path="/" component={App}></Route>
      <Route path="/About" component={About}></Route>
    </Switch>
  </Router>,
  document.getElementById('root')
);
